import React from "react";
import '../../App.css';
import CatBox from './CatBox';
import './Category.css';
function Category() {
    return (
        <>
        <CatBox
            src="images/category/cat_1.png"
            text="Sports" 
            label="Football"
            path = "/quizcategory"
            />
            </>
    );
}
export default Category;
